import logo from './logo.svg';
import './App.css';
import Cbody from './body';



import React, { useState } from 'react';

const Navbar = () => {
      const [isOpen, setIsOpen] = useState(false);

      const toggleNavbar = () => {
            setIsOpen(!isOpen);
      };

      return (
            <nav className=" py-3 App home ">
                  <div className="container mx-auto ">
                        <div className="flex justify-between items-center">


                              <div className=" text-xl text-black flex space-x-4"> <img src="images/m.jpg" className='pt-1 mx-1 md:h-10 rounded-full' /><h1>
                                    MITHILESH KUMAAR.</h1></div>
                              <div className="md:hidden text-3xl cursor-pointer">
                                    {/* <button
              className="text-white text-xl"
              onClick={toggleNavbar}
            >
              {isOpen ? 'Close' : 'Menu'}
            </button> */}

                                    <ion-icon name={isOpen ? 'Close' : 'Menu'} className="text-white "
                                          onClick={toggleNavbar}>


                                    </ion-icon>
                              </div>
                              <div className={`md:flex ${isOpen ? 'block' : 'hidden'}`}>
                                    <ul className="md:flex space-x-4 px-3">
                                          <li>
                                                <button href="#" className="text-white button ">Home</button>
                                          </li>
                                          <li>
                                                <button href="#" className="text-white button ">projects</button>
                                          </li>
                                          <li>
                                                <button href="#" className="text-white button ">about me</button>
                                          </li>
                                          <li>
                                                <button href="#" className="text-white button ">contact</button>
                                          </li>

                                    </ul>
                              </div>
                        </div>
                  </div>
            </nav>


      );
};

export default Navbar;
